import{_ as e,c as t,a2 as o,o as r}from"./chunks/framework.3VuPyQdv.js";const s="/docs-demo/wxImages/%E5%8D%8F%E5%90%8C%E5%B7%A5%E4%BD%9C%E5%92%8C%E5%8F%91%E5%B8%83(%E4%B8%8A%E4%BC%A0%E4%BB%A3%E7%A0%81).png",E="/docs-demo/wxImages/%E5%9C%A8%E5%90%8E%E5%8F%B0%E6%9F%A5%E7%9C%8B%E4%B8%8A%E4%BC%A0%E4%B9%8B%E5%90%8E%E7%9A%84%E7%89%88%E6%9C%AC.png",p="/docs-demo/wxImages/%E5%B0%8F%E7%A8%8B%E5%BA%8F%E7%9A%84%E4%B8%8A%E7%BA%BF%E5%92%8C%E5%8F%91%E5%B8%83(%E6%8F%90%E4%BA%A4%E5%AE%A1%E6%A0%B8).png",i="/docs-demo/wxImages/%E5%B0%8F%E7%A8%8B%E5%BA%8F%E7%9A%84%E5%8F%91%E5%B8%83.png",m="/docs-demo/wxImages/%E5%BE%AE%E4%BF%A1%E7%9A%84%E4%BA%8C%E7%BB%B4%E7%A0%81.png",l="/docs-demo/wxImages/%E5%B0%8F%E7%A8%8B%E5%BA%8F%E7%9A%84%E4%BA%8C%E7%BB%B4%E7%A0%81.png",x=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"doc-text/wx/wx13.md","filePath":"doc-text/wx/wx13.md","lastUpdated":1743335057000}'),d={name:"doc-text/wx/wx13.md"};function n(c,a,h,B,_,g){return r(),t("div",null,a[0]||(a[0]=[o('<h2 id="_12-协同工作和发布-发布上线" tabindex="-1">12. 协同工作和发布 - 发布上线 <a class="header-anchor" href="#_12-协同工作和发布-发布上线" aria-label="Permalink to &quot;12. 协同工作和发布 - 发布上线&quot;">​</a></h2><h4 id="_12-1-小程序发布上线的整体步骤" tabindex="-1">12.1 小程序发布上线的整体步骤 <a class="header-anchor" href="#_12-1-小程序发布上线的整体步骤" aria-label="Permalink to &quot;12.1 小程序发布上线的整体步骤&quot;">​</a></h4><p>​ 一个小程序的发布上线，一般要经过上传代码 -&gt; 提交审核 -&gt; 发布这三个步骤。</p><h4 id="_12-2-上传代码" tabindex="-1">12.2 上传代码 <a class="header-anchor" href="#_12-2-上传代码" aria-label="Permalink to &quot;12.2 上传代码&quot;">​</a></h4><p>​ ①点击开发者工具顶部工具栏中的“上传” 按钮</p><p>​ ②填写版本号以及项目备注</p><p>​</p><img src="'+s+'" alt="image-20230301223353214" style="zoom:50%;"><hr><h4 id="_12-3-在后台查看上传之后的版本" tabindex="-1">12.3 在后台查看上传之后的版本 <a class="header-anchor" href="#_12-3-在后台查看上传之后的版本" aria-label="Permalink to &quot;12.3 在后台查看上传之后的版本&quot;">​</a></h4><p>​ 登录小程序管理后台 -&gt; 管理 -&gt; 版本管理 -&gt; 开发版本，即可查看刚才提交上传的版本了：</p><img src="'+E+'" alt="image-20230301223505759" style="zoom:50%;"><hr><h4 id="_12-4提交审核" tabindex="-1">12.4提交审核 <a class="header-anchor" href="#_12-4提交审核" aria-label="Permalink to &quot;12.4提交审核&quot;">​</a></h4><p>​ 为什么需要提交审核：为了保证小程序的质量，以及符合相关的规范，小程序的发布是需要经过腾讯官方审核的。</p><p>​ 提交审核的方式：在开发版本的列表中，点击“提交审核”按钮之后，按照页面提示填写相关的信息，就能把小程序提交到腾讯官方进行审核。</p><img src="'+p+'" alt="image-20230301223650677" style="zoom:50%;"><hr><h4 id="_12-5-发布" tabindex="-1">12.5 发布 <a class="header-anchor" href="#_12-5-发布" aria-label="Permalink to &quot;12.5 发布&quot;">​</a></h4><p>​ 审核通过之后，管理员的微信中会收到小程序通过审核的通知，此时在审核版本的列表中，点击“发布”按钮之后，即可把“审核通过”的版本发布为“线上版本”，供所有小程序用户访问和使用。</p><img src="'+i+'" alt="image-20230301223754758" style="zoom:50%;"><hr><h4 id="_12-6-基于小程序码进行推广" tabindex="-1">12.6 基于小程序码进行推广 <a class="header-anchor" href="#_12-6-基于小程序码进行推广" aria-label="Permalink to &quot;12.6 基于小程序码进行推广&quot;">​</a></h4><p>​ 相对于普通二维码来说，小程序码的优势如下：</p><p>​ ①在样式上更具辨识度和视觉冲击力</p><p>​ ②能够更加清晰地树立小程序的品牌形象</p><p>​ ③可以帮助开发者更好地推广小程序</p><p>​ <img src="'+m+'" alt="image-20230301223952401" style="zoom:67%;"></p><p>​ ●获取小程序码的 5 个步骤：</p><p>​ 登录小程序管理后台 -&gt; 设置 -&gt; 基本设置 -&gt; 基本信息 -&gt; 小程序码及线下物料下载</p><p>​</p><p>​ <img src="'+l+'" alt="image-20230301224032993" style="zoom:67%;"></p>',32)]))}const u=e(d,[["render",n]]);export{x as __pageData,u as default};
